import React, { Component } from 'react';
import './assets/section.css';
import project1 from './assets/images/project1.png';
import project2 from './assets/images/project2.png';
import project3 from './assets/images/project3.png';

class Projects extends Component{
    render(){
        return(
            <div className = "container" style = {{ background : "#222222" }}>
                <h1>My <strong>Projects</strong></h1>
                <div className = "row">
                    
                    {/* project 1 */}
                    <div className = "col-md-4">
                        <div className = "card">
                            <img src = { project1 } alt = "NodeJs project"/>
                            <div className = "card-body">
                                <h4>Blog API using NodeJS,MongoDB and Express</h4>
                                <p className = "lead">
                                    This is a simple Blog page i made using NodeJS, MongoDB and Express. This has a login and register page and after login you have an editor where you can upload your blog and you can even edit and delete those blogs!
                                </p>
                            </div>
                        </div>
                    </div>

                    {/* Project 2 */}
                    <div className = "col-md-4">
                        <div className = "card">
                            <img src = { project2 } alt = "Spectrum Club"/>
                            <div className = "card-body">
                                <h4>Technical Club Website</h4>
                                <p className = "lead">
                                    This is a site for a Technical Club Website of my college. I made it using a template from templated.co and I made some frontend modifications by adding some new sections to the site, i also made a student login and registration system!
                                </p>
                            </div>
                        </div>
                    </div>

                    {/* Project 3 */}
                    <div className = "col-md-4">
                        <div className = "card">
                            <img src = { project3 } alt = "Student Attendance System"/>
                            <div className = "card-body">
                                <h4>Student Attendance System</h4>
                                <p className = "lead">
                                This is a student attendance system i made using PHP as backend language. This technology can be used by teachers to get rid of the traditional methods of attendance management.
                                </p>
                            </div>
                        </div>
                    </div>


                
                </div>
            </div>
        );
    }
}

export default Projects;
